 const thoughts = "{\"parsed\":{\"_path\":\"/articles/thoughts\",\"_dir\":\"articles\",\"_draft\":false,\"_partial\":false,\"_locale\":\"\",\"title\":\"thoughts\",\"description\":\"xx\",\"date\":\"2025-11-12\",\"body\":{\"type\":\"root\",\"children\":[{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Feeling lonely in a crowd never ends well.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I'm so tired of negative energy.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Until today, I've always tried to do my job to the best of my ability. I never even cared about the money; it was all about gaining respect.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"From now on, I'm moving into a work rhythm where I feel better.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Why all this effort?\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I'm the kind of person who can be happy with small things, yet I try to see everyone around me happy, and I'm realizing it's not possible.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I no longer want to prevent any problems that might arise, nor do I want to solve them when they do.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"In this long void, I'm starting to envy the small things people have that they fail to appreciate.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I'm writing these things down to see what I've been overlooking. I don't even remember the last time I did what I wanted to do.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I need to apologize to everyone I've hurt, respect my work, and keep doing the one thing I know how to do best.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"For someone who is emotional in their relationships, this is a dungeon.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I'm writing this for my friends who refuse to show any understanding. The old \\\"Pasha\\\" (The old me) is gone; he's dead.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"The flaws start to show, and you find yourself trying to win a war waged more against yourself than against the world around you.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"In the end, it's a dream. It seems this was the story of my dreams all along.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"I prayed for rain, and now I have to endure the mud.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"You decide whether you are the rain or the mud.\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"As for me, I am used to the mud, and I know very well how to get clean.\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":3,\"depth\":3,\"links\":[]}},\"_type\":\"markdown\",\"_id\":\"content:articles:thoughts.md\",\"_source\":\"content\",\"_file\":\"articles/thoughts.md\",\"_stem\":\"articles/thoughts\",\"_extension\":\"md\"},\"hash\":\"SxlFALJZBj\"}";

